import React, { Component } from 'react';

import {
  View,
  Text,
  Platform,
  TextInput
} from 'react-native';

export default class CustomComponent extends Component{
    static propTypes = {
        FuelUp :JSON,
    }

    render(){
        return(
            <View style={styles.top} >
            <Text style={styles.text}>{r.date}</Text>
            </View> )}
        

}
